import React from "react";

function QnAQuestionsAnalysis() {
  return (
    <div>
      <div style={{ height: "15vh", width: "100%", backgroundColor: "black" }}>
        <div>
          <p
            style={{
              color: "white",
              fontSize: "1.8em",
              fontWeight: "600",
              paddingTop: "4.5vh",
              paddingLeft: "10vw",
            }}
          >
            Quiz 2 Question Analysis
          </p>
        </div>
      </div>
    </div>
  );
}

export default QnAQuestionsAnalysis;
